import React from 'react';
import './MailMessage.css';
import Checkbox from '@material-ui/core/Checkbox';
import StarBorderIcon from '@material-ui/icons/StarBorder';
import IconButton from '@material-ui/core/IconButton';

function MailMessage(props) {
    return (
        <div className="mail-message">
            <div className="mail-box-left">
                <Checkbox/>
                <IconButton>
                 <StarBorderIcon/>
                </IconButton>
                <span className="mail-subject-message">Subject Message: </span>
                <span className="mail-tag">Tag </span>
            </div>
            <div className="mail-box-center">
                <span className="maiil-descriptin-message">Description Message</span>
            </div>
            <div className="Mail-box-right">
                <span className="mail-date-time">Date and Time</span>
            </div>
        </div>
    );
}

export default MailMessage;
